class FavoriteItem extends Component {

    constructor(props){
        super(props)
        const URL = `http://127.0.0.1:8080/api//item/id/${item_id.item}`
        axios.get(URL)
            .then(res => {
                console.log(res.data[0].name);
                this.state = { name: res.data[0].name }
            })
    }
    render() {
        const {item} = this.props
        return (
            <Link to={`/${item.name}`} className='items-card' >
                <img src={`/${item.img}`} />
            </Link>
        )
    }


}

export { FavoriteItem }
